import React, { useState, useEffect, useCallback } from 'react';
import {Button, Input, Form} from 'antd';
import axios from 'axios';
const Home = () => {
    const [userName, setUsernName] = useState('');

    const onSubmit = useCallback(async (e) => {
        e.preventDefault();
        const zz = await axios.get(`http://localhost:3065/user/${userName}`);
        console.log(zz);
    }, [userName]);

    const onChangeName = useCallback((e) => {
        setUsernName(e.target.value)
    }, [])
    return (
        <Form onSubmit={onSubmit}>
            <Input value = {userName} onChange={onChangeName}></Input>
            <Button type = 'primary' htmlType ="submit">검색</Button>
        </Form>
    );
};

export default Home;
